/* tslint:disable */
/* eslint-disable */
import { HttpClient, HttpContext, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { filter, map } from 'rxjs/operators';
import { StrictHttpResponse } from '../../strict-http-response';
import { RequestBuilder } from '../../request-builder';

import { FoodRm } from '../../models/food-rm';

export interface ListFood$Params {
  id?: string;
  email: string;
}

export function listFood(http: HttpClient, rootUrl: string, params: ListFood$Params, context?: HttpContext): Observable<StrictHttpResponse<Array<FoodRm>>> {
  const rb = new RequestBuilder(rootUrl, listFood.PATH, 'get');
  if (params) {
    rb.query('id', params.id, {});
    rb.path('email', params.email, {});
  }

  return http.request(
    rb.build({ responseType: 'json', accept: 'text/json', context })
  ).pipe(
    filter((r: any): r is HttpResponse<any> => r instanceof HttpResponse),
    map((r: HttpResponse<any>) => {
      return r as StrictHttpResponse<Array<FoodRm>>;
    })
  );
}

listFood.PATH = '/Food/list/{email}';
